export default function CamposExpansor({ campos }) {
  return (
    <div className="space-y-2">
      {campos.map((campo, index) => (
        <details key={index} className="bg-white p-4 rounded shadow">
          <summary className="cursor-pointer font-medium">{campo.nome}</summary>
          <p className="mt-2 text-gray-600">{campo.descricao}</p>
        </details>
      ))}
    </div>
  );
}
